/* eslint-disable jsx-a11y/anchor-is-valid */
/* eslint-disable jsx-a11y/no-noninteractive-element-interactions */
/* eslint-disable jsx-a11y/click-events-have-key-events */
import React, { useState } from 'react';

const Applicants = () => {
  const applicantsSectionEnum = {
    SEARCH: 'SEARCH',
    TO_REVIEW: 'TO_REVIEW',
    FRIEND_PASS: 'FRIEND_PASS',
    ACCEPTED_PUSH_TO_RELEASE: 'ACCEPTED_PUSH_TO_RELEASE',
    GIA: 'GIA',
    WAITLISTED_PUSH_TO_RELEASE: 'WAITLISTED_PUSH_TO_RELEASE',
    ACCEPTED_ON_APP: 'ACCEPTED_ON_APP',
    WAITLISTED: 'WAITLISTED',
    BANNED: 'BANNED',
  };

  const [applicantsSection, setApplicantsSection] = useState(applicantsSectionEnum.SEARCH);

  const applicantsSectionOnClickHandler = (e) => {
    const sectino = e.target.dataset.remove;
    setApplicantsSection(applicantsSectionEnum.SEARCH);
    console.log('clicked');
  };

  return (
    <div>
      <div className="tabs is-boxed">
        <ul>
          <li
            section={applicantsSectionEnum.SEARCH}
            onClick={(e) => applicantsSectionOnClickHandler(e)}
            className={`${applicantsSection === applicantsSectionEnum.SEARCH ? 'is-active' : ''}`}
          >
            <a>
              Search
            </a>
          </li>
          <li
            onClick={(e) => applicantsSectionOnClickHandler(e)}
            className={`${applicantsSection === applicantsSectionEnum.TO_REVIEW ? 'is-active' : ''}`}
          >
            <a>
              To Review
            </a>
          </li>
          <li
            onClick={(e) => applicantsSectionOnClickHandler(e)}
            className={`${applicantsSection === applicantsSectionEnum.FRIEND_PASS ? 'is-active' : ''}`}
          >
            <a>
              Friend Pass
            </a>
          </li>
          <li
            onClick={(e) => applicantsSectionOnClickHandler(e)}
            className={`${applicantsSection === applicantsSectionEnum.ACCEPTED_PUSH_TO_RELEASE ? 'is-active' : ''}`}
          >
            <a>
              Accepted: Push to Release
            </a>
          </li>
          <li
            onClick={(e) => applicantsSectionOnClickHandler(e)}
            className={`${applicantsSection === applicantsSectionEnum.GIA ? 'is-active' : ''}`}
          >
            <a>
              GIA
            </a>
          </li>
          <li
            onClick={(e) => applicantsSectionOnClickHandler(e)}
            className={`${applicantsSection === applicantsSectionEnum.WAITLISTED_PUSH_TO_RELEASE ? 'is-active' : ''}`}
          >
            <a>
              Waitlisted: Push to Release
            </a>
          </li>
          <li
            onClick={(e) => applicantsSectionOnClickHandler(e)}
            className={`${applicantsSection === applicantsSectionEnum.ACCEPTED_ON_APP ? 'is-active' : ''}`}
          >
            <a>
              Accepted: On App
            </a>
          </li>
          <li
            onClick={(e) => applicantsSectionOnClickHandler(e)}
            className={`${applicantsSection === applicantsSectionEnum.WAITLISTED ? 'is-active' : ''}`}
          >
            <a>
              Waitlisted
            </a>
          </li>
          <li
            onClick={(e) => applicantsSectionOnClickHandler(e)}
            className={`${applicantsSection === applicantsSectionEnum.BANNED ? 'is-active' : ''}`}
          >
            <a>
              Banned
            </a>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default Applicants;
